fac83d6423f1d3d5141e792b0bbcdf8f51408859:
query HolderQuery($tokenId: ID) {
  accountBalances(
    where: {token_: {id: $tokenId}}
    orderBy: amount
    orderDirection: desc
  ) {
    account {
      address
    }
    amount
  }
}

8f86fbb95499e5745e3bb590e381e95377b52bc8:
query LastSwap {
  swaps(first: 10, orderBy: timestamp, orderDirection: desc) {
    amount0
    amount1
    amountUSD
    id
    logIndex
    origin
    recipient
    sender
    sqrtPriceX96
    tick
    timestamp
    pool {
      id
      token0 {
        id
        name
        symbol
      }
      token1 {
        id
        name
        symbol
      }
    }
  }
}

